.accordion, .accordion .a-container {
    display: flex;
    flex-direction: column;
    width: 100%
}

.accordion {
    height: auto;
    text-align: left
}

.accordion .a-container {
    padding-bottom: 5px;
    padding-top: 5px;
    border-bottom: 1px solid #fff
}

.accordion .a-container .a-btn {
    margin: 0;
    position: relative;
    width: 100%;
    color: #fff;
    text-align: left;
    font-weight: 700;
    display: block;
    cursor: pointer;
    transition: all .3s ease-in-out;
    padding: 15px 30px 15px 0
}

.accordion .a-container .a-btn span {
    position: absolute;
    right: 0;
    top: 16px;
    width: 18px;
    height: 18px;
    background: url(../images/arrow-alt.svg) no-repeat center;
    background-size: contain;
    display: block
}

.accordion .a-container .a-panel {
    width: 100%;
    color: #fff;
    font-size: 15px;
    line-height: 1.7;
    transition: all .2s ease-in-out;
    opacity: 0;
    height: auto;
    max-height: 0;
    overflow: hidden;
    padding: 0 10px
}

.accordion .a-container .a-panel p+p {
    margin-top: 15px
}

.accordion .a-container .a-panel .primary-cta {
    margin-top: 15px;
    width: 100%;
}

.accordion .a-container.active .a-btn span {
    transform: rotate(90deg)
}

.accordion .a-container.active .a-panel {
    padding: 10px 10px 20px;
    opacity: 1;
    max-height: 500px
}

